SELECT COUNT(*) as agg_0 FROM "L_AIRLINE_ID" LEFT OUTER JOIN "On_Time_On_Time_Performance_2016_1" ON "L_AIRLINE_ID"."Code" = "On_Time_On_Time_Performance_2016_1"."AirlineID" LEFT OUTER JOIN "L_DISTANCE_GROUP_250" ON "On_Time_On_Time_Performance_2016_1"."DistanceGroup" = "L_DISTANCE_GROUP_250"."Code" LEFT OUTER JOIN "L_CITY_MARKET_ID" ON "On_Time_On_Time_Performance_2016_1"."DestCityMarketID" = "L_CITY_MARKET_ID"."Code" LEFT OUTER JOIN "L_ONTIME_DELAY_GROUPS" ON "On_Time_On_Time_Performance_2016_1"."DepartureDelayGroups" = "L_ONTIME_DELAY_GROUPS"."Code"  WHERE ("On_Time_On_Time_Performance_2016_1"."FlightDate" != '2016-01-15' OR ("On_Time_On_Time_Performance_2016_1"."FlightDate" LIKE '%2016-01-28%' AND "On_Time_On_Time_Performance_2016_1"."FlightDate" NOT LIKE '%2016-01-20%')) AND ("On_Time_On_Time_Performance_2016_1"."Div1WheelsOff" IS NOT NULL OR "On_Time_On_Time_Performance_2016_1"."DepDel15" >= 0.0) AND "L_ONTIME_DELAY_GROUPS"."Description" LIKE '%165%' AND "L_ONTIME_DELAY_GROUPS"."Description" = 'Delay between 120 to 134 minutes' AND "On_Time_On_Time_Performance_2016_1"."Carrier" IN ('NK', 'DL', 'EV', 'AS', 'UA', 'AA', 'WN', 'OO', 'F9')